import React from "react"
import './login.css'

function Login() {
    return (
        <div className="login-wrapper">
            <form>
                <div className="user-type-container">
                    <input type="radio" name="user-type" value="Theripist" onClick="changecolor" className="user-type">Theripist</input>
                    <input type="radio" name="user-type" value="Student" onClick="changecolor" className="user-type">Student</input>
                </div>
                 type="number" name='amount' value={this.props.number} 
                <div className="userName-input">UserName</div>
                <div className="password-input">password</div>
                <div className="patient-code-input">special code</div>
            </form>


        </div>
    )
}
export default Login;
